import React, { useEffect, useState, useRef } from "react";
import "@tomtom-international/web-sdk-maps/dist/maps.css";
import * as tt from "@tomtom-international/web-sdk-maps";
import axios from "axios";

const HomePage = (props) => {
  const mapElement = useRef();
  const [mapZoom, setMapZoom] = useState(13);
  const [map, setMap] = useState({});
  const [search, setSearch] = useState("");
  const [searchResults, setSearchResults] = useState([]);

  const searchHandler = async () => {
    await axios
      .get(
        `https://api.tomtom.com/search/2/autocomplete/${search}.json?key={Your_API_Key}&language=en-US`
      )
      .then((response) => {
        console.log(response.data);
        //setSearchResults(response.data);
      });
  };

  useEffect(() => {
    let map = tt.map({
      key: "66AS5Y04A9wZlAR4jt93xH6dCVAwLzUr",
      stylesVisibility: {
        trafficIncidents: true,
        trafficFlow: true,
      },
      container: mapElement.current,
      center: [10.33, 45.432],
      zoom: mapZoom,
    });
    // var marker = new tt.Marker()
    //   .setLngLat([props.location[0], props.location[1]])
    //   .addTo(map);

    setMap(map);
    return () => map.remove();
  }, []);
  return (
    <>
      <h1 className="text-center">Home</h1>
      <div className="container">
        <div className="row">
          <div className="col-8">
            <div id="main-map" ref={mapElement} className="mapDiv" />
          </div>
          <div className="col-4">
            <form>
              <input
                type="text"
                placeholder="Enter Your Location"
                className="form-control"
                onChange={(e) => {
                  setSearch(e.target.value);
                }}
              />
            </form>
          </div>
        </div>
      </div>
    </>
  );
};

export default HomePage;
